$(document).ready(function(){$('body').addClass('previewReady');$('.closePreview').on('click',function(event){event.preventDefault();window.close();});$('.aboutPreview').on('click',function(){$(this).addClass('hide');});$('#resetSurvey').on('click',function(event){event.preventDefault();$('.endPreview').addClass('hide');var iFrame=$('#surveyPreview');iFrame.removeClass('hide');iFrame.attr("src",iFrame.attr("src"));});$('#surveyPreview').load(function(e){var preview;preview=$('#surveyPreview').contents();var exitButtonSel=preview.find('a.ExitBtn');if(exitButtonSel[0]){exitButtonSel[0].onclick=function(event){event.preventDefault();window.close();};}
preview.find('.pbf a').on('click',function(e){e.preventDefault();});if(preview.find('title').text().length==0){$('.endPreview').removeClass('hide');$('#surveyPreview').addClass('hide');}});});
